import React, { useState, useEffect } from "react";
import axios from "axios";
import './App.css';

function App() {

  let [ posts, setPosts ] = useState([{
    "author": "--",
    "title": "--",
    "description": "--",
    "url": "--",
    "publishedAt": "--",
    "content": "--",
}]);

  useEffect(() => {
    const getResults = async() =>{
      console.log("DENTRO DE LA FUNCION DEL USEEFFECT");
      await axios("https://newsapi.org/v2/top-headlines?q=statistics&apiKey=e52e187dd3c848ff9aa0da5f007a8590")
      .then(response=>{
        setPosts(response.data.articles);
        console.log("AQUI DEBO VER LOS DATOS");
        console.log(response);
      }).catch(error => {
        console.log(error);
      });
    }
    getResults();
  },[{
    "author": "--",
    "title": "--",
    "description": "--",
    "url": "--",
    "publishedAt": "--",
    "content": "--",
}])
  console.log(posts)

  return (
    <div className="App">
      <table>
        <tr>
          <th>Autor</th>
          <th>Titulo</th>
          <th>Descripcion</th>
          <th>URL</th>
          <th>Fecha</th>
          <th>Contenido</th>
        </tr>
        {posts.map((val, key) => {
          return (
            <tr key={key}>
              <td>{val.author}</td>
              <td>{val.title}</td>
              <td>{val.description}</td>
              <td>{val.url}</td>
              <td>{val.publishedAt}</td>
              <td>{val.content}</td>
            </tr>
          )
        })}
      </table>
    </div>

  );
}

export default App;
